INSERT INTO `hotel` VALUES ('1', 'OneOneTwo国际度假酒店', '2', '福建省', '福州市', '湛江市赤坎区岭南师范学院博雅苑', '地上停车场', '110.346828', '21.268933', '<p style=\"text-align: left;\"><strong>oneonetwo国际度假酒店拥有着绿水青山的地理环境</strong></p>\n<p style=\"text-align: left;\">拥有着自行车、摩托车和小车车位</p>\n<p style=\"text-align: left;\">寸金桥公园坐落于旁</p>\n<p style=\"text-align: left;\">价值几十万的电车带你游遍校园</p>\n<p style=\"text-align: left;\">超市、饭堂、自习室一应俱全</p>\n<p style=\"text-align: left;\">独栋独揽一区，清净无打扰</p>\n<p style=\"text-align: left;\"><strong><span style=\"color: #ff0000;\">你还等什么？快来抢先入住吧！！！</span></strong></p>', '<p style=\"text-align: left;\">?&nbsp; 停车场</p>\n<p style=\"text-align: left;\"><strong>有<span style=\"text-decoration: underline;\">免费</span>停车场</strong></p>\n<p style=\"text-align: left; padding-left: 40px;\">酒店附近提供私人停车场,无需预订</p>\n<p style=\"text-align: left; padding-left: 40px;\">步行约100-200米到达酒店大堂</p>\n<p style=\"text-align: left; padding-left: 40px;\">共60个车位(车位信息仅供参考,具体以实际为准)</p>\n<p style=\"text-align: left;\"><strong>无充电车位</strong></p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\"><strong>?</strong> 网络</p>\n<p style=\"text-align: left;\">公用区WIFI免费</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\">?&nbsp; 淋浴设施</p>\n<p style=\"text-align: left;\">有花洒 | 24小时热水直供 | 一次性洗浴用具</p>', '<p style=\"text-align: left;\">⏰ &nbsp;入离时间</p>\n<p style=\"text-align: left;\">入住时间: 14:00以后&nbsp;&nbsp; &nbsp; &nbsp;离店时间:12:00以前</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\">?&nbsp; 儿童及加床</p>\n<p style=\"text-align: left;\">酒店允许携带儿童入住。</p>\n<p style=\"text-align: left;\">1岁及以上客人按成人收费。</p>\n<p style=\"text-align: left;\"><strong>床铺</strong></p>\n<p style=\"text-align: left;\">每间客房最多容纳1名1岁以下儿童，和成人共用现有床铺。</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\">?&nbsp; 宠物</p>\n<p style=\"text-align: left;\">不可携带宠物</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\">?&nbsp; 早餐</p>\n<p style=\"text-align: left;\">酒店不提供早餐</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\">?&nbsp; 年龄限制</p>\n<p style=\"text-align: left;\">入住办理人需年满18岁</p>', '1', 'http://radz1paru.hn-bkt.clouddn.com/hotel_cover_1650039933987', null, '0', null, null, '2', '2022-04-18 02:47:19');
